</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/46d6ea2a-ef7c-4573-8f43-c4ed3505dca0.jpg\" alt=\"46d6ea2a-ef7c-4573-8f43-c4ed3505dca0\">\n					<h3>\n							Mamadou Ndiaye						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Chef de projet du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/n.jpg\" alt=\"n\">\n					<h3>\n							Ndeye Gnanga Mbaye						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Chef réseaux et système informatique du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/IMG-20210602-WA0087.jpg\" alt=\"IMG-20210602-WA0087\">\n					<h3>\n							Samba Souaré						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Développeur WEB du groupe TITANS							\n						</a>\n										</h4>\n			<h2>Formulaire</h2>		\n			<h2>Réseaux Sociaux</h2>		\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-widget-social-icons.elementor-grid-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-mobile-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-tablet-0 .elementor-widget-container{line-height:1;font-size:0}.elementor-widget-social-icons:not(.elementor-grid-0):not(.elementor-grid-tablet-0):not(.elementor-grid-mobile-0) .elementor-grid{display:inline-grid}.elementor-widget-social-icons .elementor-grid{grid-column-gap:var(--grid-column-gap,5px);grid-row-gap:var(--grid-row-gap,5px);grid-template-columns:var(--grid-template-columns);-webkit-box-pack:var(--justify-content,center);-ms-flex-pack:var(--justify-content,center);justify-content:var(--justify-content,center);justify-items:var(--justify-content,center)}.elementor-icon.elementor-social-icon{font-size:var(--icon-size,25px);line-height:var(--icon-