(97, 1, '2022-02-23 20:24:12', '2022-02-23 19:24:12', '<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Rapide, Fiable, Sécurisé</h2>		\n		<p>Télécharger notre appli pour une meilleure expérience de l’assurance.</p>		\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"1024\" height=\"819\" src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/06cPBAbw_4x.png\" alt=\"\" loading=\"lazy\" />															\n			<a href=\"#telecharger-l-appli\" role=\"button\">\n						Télécharger l\'appli\n					</a>\n			<a href=\"#apercu\" role=\"button\">\n						Voir la démo\n					</a>\n			<h2>A propos de l\'aplication</h2>		\n		<p>Dans sa politique de digitalisation du secteur de l’assurance, Xoole Assurance met à disposition de ses clients une application mobile dans le cadre de leurs différents services à savoir la gestion de l’assurance et des sinistres. Avec l’application les clients n’ont plus besoin de se déplacer pour régler les différentes formalités d’assurance.<br />Ils ont la possibilité de souscrire ou renouveler les différents types d’assurance proposés par l’entreprise ainsi que de déclarer leurs sini