ating{font-family:Arial,Helvetica,sans-serif}.elementor--star-style-star_unicode .elementor-star-rating i:not(.elementor-star-empty):before{content:\"\002605\"}</style>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 5/5		\n		<p>Temps de chargement rapide, facilité d’usage avec un numéro de téléphone permettant de joindre le service client.</p>		\n			<a href=\"#\" role=\"button\">\n						Antoine Basse\n					</a>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 4/5		\n		<p>Je suis vraiment satisfait. J\'ai souvent du mal à déclarer mes sinistres. Ça prenait beaucoup de temps et ça ne m\'arrangeait vraiment pas. Ici, juste quelques clics et c\'est réglé.</p>		\n			<a href=\"#\" role=\"button\">\n						Maimouna Diop\n					</a>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 5/5		\n		<p>J’ai découvert l’entreprise grâce à l’application. J’ai pu souscrire sans soucis. Elle est facile à utiliser et répond aux besoins de gens toujours occupés comme moi.</p>		\n			<h2>Télécharger GRATUITEMENT l\'application</h2>		\n			<a href=\"#\" role=\"button\">\n						Disponible sur Google Play\n					</a>\n			<a href=\"#\" role=\"button\">\n						Disponible sur App Store\n					</a>\n			<h2>Team</h2>		\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/EBF67789-7ACE-42F7-942A-D6A8661A39B5.jpg\" alt=\"EBF67789-7ACE-42F7-942A-D6A8661A39B5\">\n					<h3>\n							Amadou Mouhamadou Diallo						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Responsable marketing du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/IMG_2858.jpg\" alt=\"IMG_2858\">\n					<h3>\n							Sokhna Aminata Bamé						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Directrice Générale du groupe TITANS							\n						</a>\n										<