(99, 1, '2022-02-24 10:25:55', '2022-02-24 09:25:55', '<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>Rapide, Fiable, Sécurisé</h2>		\n		<p>Télécharger notre appli pour une meilleure expérience de l’assurance.</p>		\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"1024\" height=\"819\" src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/06cPBAbw_4x.png\" alt=\"\" loading=\"lazy\" />															\n			<a href=\"#telecharger-l-appli\" role=\"button\">\n						Télécharger l\'appli\n					</a>\n			<a href=\"#apercu\" role=\"button\">\n						Voir la démo\n					</a>\n			<h2>A propos de l\'aplication</h2>		\n		<p>Dans sa politique de digitalisation du secteur de l’assurance, Xoole Assurance met à disposition de ses clients une application mobile dans le cadre de leurs différents services à savoir la gestion de l’assurance et des sinistres. Avec l’application les clients n’ont plus besoin de se déplacer pour régler les différentes formalités d’assurance.<br />Ils ont la possibilité de souscrire ou renouveler les différents types d’assurance proposés par l’entreprise ainsi que de déclarer leurs sinistres immédiatement au niveau de l’application afin d\'être pris en charge dans des délais records.</p>		\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-widget.elementor-icon-list--layout-inline .elementor-widget-container{overflow:hidden}.elementor-widget .elementor-icon-list-items.elementor-inline-items{margin-right:-8px;margin-left:-8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item{margin-right:8px;margin-left:8px}.elementor-widget .elementor-icon-list-items.elementor-inline-items .elementor-icon-list-item:after{width:auto;left:auto;right:auto;position:relative;height:100%;border-top:0;border-bottom:0;border-right:0;border-left-width:1px;border-style:solid;right:-8px}.elementor-widget .elementor-icon-list-items{list-style-type:none;margin:0;padding:0}.elementor-widget .elementor-icon-list-item{margin:0;padding:0;position:relative}.elementor-widget .elementor-icon-list-item:after{position:absolute;bottom:0;width:100%}.elementor-widget .elementor-icon-list-item,.elementor-widget .elementor-icon-list-item a{display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-align:center;-ms-flex-align:center;align-items:center;font-size:inherit}.elementor-widget .elementor-icon-list-icon+.elementor-icon-list-text{-ms-flex-item-align:center;align-self:center;padding-left:5px}.elementor-widget .elementor-icon-list-icon{display:-webkit-box;display:-ms-flexbox;display:flex}.elementor-widget .elementor-icon-list-icon svg{width:var(--e-icon-list-icon-size,1em);height:var(--e-icon-list-icon-size,1em)}.elementor-widget .elementor-icon-list-icon i{width:1.25em;font-size:var(--e-icon-list-icon-size)}.elementor-widget.elementor-widget-icon-list .elementor-icon-list-icon{text-align:var(--e-icon-list-icon-align)}.elementor-widget.elementor-widget-icon-list .elementor-icon-list-icon svg{margin:var(--e-icon-list-icon-margin,0 calc(var(--e-icon-list-icon-size, 1em) * .25) 0 0)}.elementor-widget.elementor-list-item-link-ful