ating__wrapper{display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-align:center;-ms-flex-align:center;align-items:center}.elementor-star-rating__title{margin-right:10px}.elementor-star-rating--align-right .elementor-star-rating__wrapper{text-align:right;-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end}.elementor-star-rating--align-left .elementor-star-rating__wrapper{text-align:left;-webkit-box-pack:start;-ms-flex-pack:start;justify-content:flex-start}.elementor-star-rating--align-center .elementor-star-rating__wrapper{text-align:center;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center}.elementor-star-rating--align-justify .elementor-star-rating__title{margin-right:auto}@media (max-width:1024px){.elementor-star-rating-tablet--align-right .elementor-star-rating__wrapper{text-align:right;-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end}.elementor-star-rating-tablet--align-left .elementor-star-rating__wrapper{text-align:left;-webkit-box-pack:start;-ms-flex-pack:start;justify-content:flex-start}.elementor-star-rating-tablet--align-center .elementor-star-rating__wrapper{text-align:center;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center}.elementor-star-rating-tablet--align-justify .elementor-star-rating__title{margin-right:auto}}@media (max-width:767px){.elementor-star-rating-mobile--align-right .elementor-star-rating__wrapper{text-align:right;-webkit-box-pack:end;-ms-flex-pack:end;justify-content:flex-end}.elementor-star-rating-mobile--align-left .elementor-star-rating__wrapper{text-align:left;-webkit-box-pack:start;-ms-flex-pack:start;justify-content:flex-start}.elementor-star-rating-mobile--align-center .elementor-star-rating__wrapper{text-align:center;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center}.elementor-star-rating-mobile--align-justify .elementor-star-rating__title{margin-right:auto}}.last-star{letter-spacing:0}.elementor--star-style-star_unicode .elementor-star-rating{font-family:Arial,Helvetica,sans-serif}.elementor--star-style-star_unicode .elementor-star-rating i:not(.elementor-star-empty):before{content:\"\002605\"}</style>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 5/5		\n		<p>Temps de chargement rapide, facilité d’usage avec un numéro de téléphone permettant de joindre le service client.</p>		\n			<a href=\"#\" role=\"button\">\n						Antoine Basse\n					</a>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 4/5		\n		<p>Je suis vraiment satisfait. J\'ai souvent du mal à déclarer mes sinistres. Ça prenait beaucoup de temps et ça ne m\'arrangeait vraiment pas. Ici, juste quelques clics et c\'est réglé.</p>		\n			<a href=\"#\" role=\"button\">\n						Maimouna Diop\n					</a>\n						<i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i><i>&#xE934;</i> 5/5		\n		<p>J’ai découvert l’entreprise grâce à l’application. J’ai pu souscrire sans soucis. Elle est facile à utiliser et répond aux besoins de gens toujours occupés comme moi.</p>		\n			<h2>Télécharger GRATUITEMENT l\'application</h2>		\n			<a href=\"#\" role=\"button\">\n						Disponible sur Google Play\n					</a>\n			<a href=\"#\" role=\"button\">\n						Disponible sur App Store\n					</a>\n			<h2>Team</h2>		\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/EBF67789-7ACE-42F7-942A-D6A8661A39B5.jpg\" alt=\"EBF67789-7ACE-42F7-942A-D6A8661A39B5\">\n					<h3>\n							Amadou Mouhamadou Diallo						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Responsable marketing du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/IMG_2858.jpg\" alt=\"IMG_2858\">\n					<h3>\n							Sokhna Aminata Bamé						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Directrice Générale du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/46d6ea2a-ef7c-4573-8f43-c4ed3505dca0.jpg\" alt=\"46d6ea2a-ef7c-4573-8f43-c4ed3505dca0\">\n					<h3>\n							Mamadou Ndiaye						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Chef de projet du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/n.jpg\" alt=\"n\">\n					<h3>\n							Ndeye Gnanga Mbaye						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Chef réseaux et système informatique du groupe TITANS							\n						</a>\n										</h4>\n						<img src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/IMG-20210602-WA0087.jpg\" alt=\"IMG-20210602-WA0087\">\n					<h3>\n							Samba Souaré						\n					</h3>\n					-\n					<h4>\n											<a target=\"_blank\" rel=\"noopener\">\n								Développeur WEB du groupe TITANS							\n						</a>\n										</h4>\n			<h2>Formulaire</h2>		\n			<h2>Réseaux Sociaux</h2>		\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-widget-social-icons.elementor-grid-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-mobile-0 .elementor-widget-container,.elementor-widget-social-icons.elementor-grid-tablet-0 .elementor-widget-container{line-height:1;font-size:0}.elementor-widget-social-icons:not(.elementor-grid-0):not(.elementor-grid-tablet-0):not(.elementor-grid-mobile-0) .elementor-grid{display:inline-grid}.elementor-widget-social-icons .elementor-grid{grid-column-gap:var(--grid-column-gap,5px);grid-row-gap:var(--grid-row-gap,5px);grid-template-columns:var(--grid-template-columns);-webkit-box-pack:var(--justify-content,center);-ms-flex-pack:var(--justify-content,center);justify-content:var(--justify-content,center);justify-items:var(--justify-content,center)}.elementor-icon.elementor-social-icon{font-size:var(--icon-size,25px);line-height:var(--icon-