\n							<li>\n									</li>\n								<li>\n									</li>\n						</ul>\n					<ul>\n							<li>\n									</li>\n								<li>\n									</li>\n						</ul>\n			<h2>Fonctionnalités</h2>		\n															<img width=\"612\" height=\"408\" src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/65978-removebg-preview.png\" alt=\"\" loading=\"lazy\" />															\n					<ul>\n							<li>\n										Espace personnel\n									</li>\n								<li>\n										Rappel renouvellemennt\n									</li>\n								<li>\n										Déclaration des sinistres en ligne\n									</li>\n								<li>\n										Accès à toutes les polices\n									</li>\n						</ul>\n			<h2>Apercu de l\'application</h2>		\n															<img width=\"620\" height=\"403\" src=\"http://localhost/maquette_xoole/wp-content/uploads/2022/02/21398619-removebg-preview-1.png\" alt=\"\" loading=\"lazy\" />															\n			<h2>Ce que disent nos clients</h2>		\n			<a href=\"#\" role=\"button\">\n						Mame Diarra Mbaye\n					</a>\n			<style>/*! elementor - v3.5.5 - 03-02-2022 */\n.elementor-star-rating{color:#ccd6df;font-family:eicons;display:inline-block}.elementor-star-rating i{display:inline-block;position:relative;font-style:normal;cursor:default}.elementor-star-rating i:before{content:\"e934\";display:block;font-size:inherit;font-family:inherit;position:absolute;overflow:hidden;color:#f0ad4e;top:0;left:0}.elementor-star-rating .elementor-star-empty:before{content:none}.elementor-star-rating .elementor-star-1:before{width:10%}.elementor-star-rating .elementor-star-2:before{width:20%}.elementor-star-rating .elementor-star-3:before{width:30%}.elementor-star-rating .elementor-star-4:before{width:40%}.elementor-star-rating .elementor-star-5:before{width:50%}.elementor-star-rating .elementor-star-6:before{width:60%}.elementor-star-rating .elementor-star-7:before{width:70%}.elementor-star-rating .elementor-star-8:before{width:80%}.elementor-star-rating .elementor-star-9:before{width:90%}.elementor-star-r